/**
 * prints the tree to the console
 *
 * @version 1.0.0
 * @param {{tree:object, showData:boolean,showChildCount:boolean,linear:boolean}}} config - destructured initialization object
 * @param {{id:string, children:Array}} config.tree - the tree root to start printing
 *
 * @example <caption>How to use</caption>
 *
 * // print the tree in a linear fashion where each depth is on a new line
 * printTree({ tree, linear: true })
 *
 * // print the tree in an expanded hierarchial display showing branches of the tree
 * printTree({ tree, linear: false })
 *
 * // print the tree in an expanded hierarchial display showing branches of the tree
 * // and display the number of children each node contains
 * printTree({ tree, showChildCount: true })
 *
 * // print the tree in an expanded hierarchial display showing branches of the tree
 * // and display the data of each node using JSON.stringify
 * printTree({ tree, showData: true })
 *
 * @see https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/JSON/stringify
 */
const printTree = ({ tree, showData = false, showChildCount = false, linear = false } = {}) => {
  if (linear) {
    const terminal = { data: '\n', children: [] }
    const queue = [tree, terminal]
    const display = []

    while (queue.length) {
      const node = queue.shift()

      if (node) {
        const data = showData ? `data=${JSON.stringify(node.data)}` : ''
        const kids = showChildCount ? `(${node.children.length})` : ''

        display.push(`[${node.id}] ${data}${kids}`)

        if (node === terminal && queue.length) {
          queue.push(terminal)
        }

        for (let i = 0; i < node.children.length; i += 1) {
          queue.push(node.children[i])
        }
      }
    }

    console.log(display.join('').slice(0, -2).trim())
  } else {
    const stack = [tree]
    const list = [stack]
    const display = []

    while (list.length) {
      const stack = list[list.length - 1]

      if (!stack.length) {
        list.pop()
      } else {
        const node = stack.shift()

        if (node) {
          const inset = []

          for (let i = 0; i < list.length - 1; i += 1) {
            inset.push(list[i].length > 0 ? '|  ' : '   ')
          }

          const data = showData ? `\n${inset.join('')}  data=${JSON.stringify(node.data)}` : ''
          const kids = showChildCount ? `(${node.children.length})` : ''

          display.push(`${inset.join('')}+- [${node.id}]${kids}${data}\n`)

          if (node.children.length) {
            list.push([...node.children])
          }
        }
      }
    }

    console.log(display.join('').trim())
  }
}

module.exports = printTree

/**
 * walk through the tree using a breadth-first search (BFS) and call visitor function for each tree node
 *
 * @version 1.0.0
 * @param {{tree:object, visitor:function(node:{id:string, children:Array})}} config - destructured initialization object
 * @param {{id:string, children:Array}} config.tree - the tree to walk
 * @param {function(node:{id:string, children:Array})} config.visitor - function to call for each tree node in the tree
 *
 * @example <caption>How to use</caption>
 *
 * walkTreeBFS({ tree, visitor (node) { console.log('visiting node', node.id) } })
 *
 * @see https://en.wikipedia.org/wiki/Breadth-first_search
 */
const walkTreeBFS = ({ tree, visitor }) => {
  const queue = [tree]

  while (queue.length) {
    const node = queue.shift()

    if (node) {
      visitor && visitor(node, tree)

      for (let i = 0; i < node.children.length; i += 1) {
        queue.push(node.children[i])
      }
    }
  }
}

module.exports = walkTreeBFS

/**
 * walk through the tree using a depth-first search (DFS) and call visitor function for each tree node
 *
 * @version 1.0.0
 * @param {{tree:object, visitor:function(node:{id:string, children:Array})}} config - destructured initialization object
 * @param {{id:string, children:Array}} config.tree - the tree to walk
 * @param {function(node:{id:string, children:Array})} config.visitor - function to call for each tree node in the tree
 *
 * @example <caption>How to use</caption>
 *
 * walkTreeDFS({ tree, visitor (node) { console.log('visiting node', node.id) } })
 *
 * @see https://en.wikipedia.org/wiki/Depth-first_search
 */
const walkTreeDFS = ({ tree, visitor, order = 'post' }) => {
  const stack = [tree]

  if (order === 'post') {
    while (stack.length) {
      const node = stack.shift()

      if (node) {
        for (let i = 0; i < node.children.length; i += 1) {
          stack.unshift(node.children[i])
        }

        visitor && visitor(node, tree)
      }
    }
  } else if (order === 'pre') {
    while (stack.length) {
      const node = stack.shift()

      if (node) {
        visitor && visitor(node, tree)

        for (let i = 0; i < node.children.length; i += 1) {
          stack.unshift(node.children[i])
        }
      }
    }
  }
}

module.exports = walkTreeDFS

const treeApi = require('../ds/tree')

// create a tree root node
const tree = treeApi.createTree({ id: 'my-tree' })

// insert a child node into the tree as a child of the root node
// offset here is optional and used for demonstration purposes. zero is the default offset
treeApi.insertTreeNode({
  parent: tree,
  offset: 0,
  node: treeApi.createTreeNode({
    id: 'child',
    data: {
      name: 'Child Node'
    }
  })
})

// insert a child node into the tree as a child of the root node
// negative offset causes the node to be inserted at the beginning of the parent children list
// a positive offset would cause the node to be inserted at the end of the parent children list
treeApi.insertTreeNode({
  parent: tree,
  offset: -1,
  node: treeApi.createTreeNode({
    id: 'sibling',
    data: {
      name: 'Sibling Node'
    }
  })
})

treeApi.insertTreeNode({
  parent: treeApi.findTreeNode({ tree, id: 'child' }),
  node: treeApi.createTreeNode({
    id: 'grandchild',
    data: {
      name: 'Grandchild Node'
    }
  })
})

treeApi.insertTreeNode({
  parent: treeApi.findTreeNode({ tree, id: 'grandchild' }),
  node: treeApi.createTreeNode({
    id: 'great-grandchild',
    data: {
      name: 'Great Grandchild Node'
    }
  })
})

// walk through the tree using a breadth-first-search and call visitor function for each tree node
treeApi.walkTreeBFS({
  tree,
  visitor (node) {
    console.log(`The current node ${node.id} data name is ${node.data.name}`)
  }
})

// delete the sibling node and all children of the sibling from the tree
treeApi.deleteTreeNode({ tree, id: 'sibling' })

// walk through the tree using a depth-first-search and call visitor function for each tree node
treeApi.walkTreeDFS({
  tree,
  visitor (node) {
    console.log(`The current node ${node.id} data name is ${node.data.name}`)
  }
})

// print the tree in a linear fashion where each depth is on a new line
treeApi.printTree({ tree, linear: true })

// print the tree in an expanded hierarchial display showing branches of the tree
treeApi.printTree({ tree, linear: false })

const tree = require('./ds/tree')

module.exports = {
  ds: {
    tree
  }
}
